    render() {
        return(
            <Fragment>
                <div className='content'>
                    <header>
                        <nav>
                            <a href="">a</a>
                            <a href="">a</a>
                            <a href="">a</a>
                            <a href="">a</a>
                            <a href="">a</a>
                        </nav>
                    </header>
                </div>
            </Fragment>
        );
    }
}

export default Content;
